import React, { useState } from "react";
import ControlCarousell from "./ControlCarousell";

const Specialty = () => {
  return (
    <div className="specialty">
      <div className="specialty__container">
        <div className="specialty__container--carousel">
          <ControlCarousell></ControlCarousell>
        </div>
      </div>
    </div>
  );
};

export default Specialty;
